import React from 'react'
import {Route, Switch, BrowserRouter as Router} from 'react-dom'
import Sidebar from './Components/Sidebar/Sidebar'

import Home from './pages/home'

function App() {
  return (
    <div className="App">
        <Sidebar />
        <Switch>
          <Route path='/home' component = {Home} />
          <Route component={() => 404} />
        </Switch> 
    </div>
  );
}

export default App;
